    <style type="text/tailwindcss">
    :root {
      --neon-blue: #00BFFF;
      --neon-purple: #8A2BE2;
    }
    body {
      font-family: 'Poppins', sans-serif;
    }
    .glassmorphism {
      background: rgba(255, 255, 255, 0.05);
      backdrop-filter: blur(10px);
      -webkit-backdrop-filter: blur(10px);
    }
    .skill-card {
      position: relative;
      overflow: hidden;
      border: 1px solid rgba(255, 255, 255, 0.1);
      transition: all 0.3s ease-in-out;
    }
    .skill-card::before {
      content: '';
      position: absolute;
      top: -50%;
      left: -50%;
      width: 200%;
      height: 200%;
      background: conic-gradient(from 0deg, transparent, rgba(0, 191, 255, 0.5), transparent);
      animation: rotate 4s linear infinite;
      z-index: -1;
    }
    .skill-card:hover {
      box-shadow: 0 0 10px var(--neon-blue), 0 0 20px var(--neon-blue), 0 0 40px var(--neon-purple);
      transform: translateY(-5px);
    }
    @keyframes rotate {
      from {
        transform: rotate(0deg);
      }
      to {
        transform: rotate(360deg);
      }
    }
    .glow {
      position: absolute;
      top: 50%;
      left: 50%;
      width: 150px;
      height: 150px;
      background: radial-gradient(circle, var(--neon-blue), var(--neon-purple));
      filter: blur(30px);
      opacity: 0.5;
      transform: translate(-50%, -50%);
      z-index: -2;
    }
    </style>
  </head>
